import "./Header.css";

// haha, it boops
export function Button({text}){
  return(
    <button>{text}</button>
  )
}

//Makes header with given title 
export default function Header({title, subtitle}){

       return (
        <div className="flex bg-bud bg-cover h-1/4 p-10 md:h-1/3 lg:h-1/3 xl:h-4/5 bg-center">
          <div className="bg-transparent flex flex-col justify-start w-min xl:m-40">

              <h1 id="header-title" className=" text-green-400 font-bold p-4 text-3xl md:p-10 ">
                {title}
              </h1>
              <p>
                {subtitle}
              </p>
              <div id="btn-container" className="flex justify-around">
                <div className="bg-purple-600 p-1  text-white m-2 hover:bg-green-400">
                  <Button text='Login'/>
                </div>
                <div className="bg-purple-600 p-1  text-white m-2 ">
                  <Button text='Signup'/>
                </div>




              </div>
          </div>
        </div>
       )
}
